# Importing necessary libraries
import os
from datetime import datetime

class Broker:
    def __init__(self):
        self.submissions = []

    def upload_file(self, file_path):
        # Upload a file to the broker
        try:
            with open(file_path, 'r') as file:
                file_content = file.read()
                self.submissions.append(file_content)
                return f"File {file_path} uploaded successfully"
        except FileNotFoundError:
            return f"File {file_path} not found"

    def validate_submission(self, submission):
        # Validate a submission
        # Checking for missing required elements
        required_elements = ["ActionType", "DUNS", "ActionDate"]
        for element in required_elements:
            if element not in submission:
                return f"Missing required element: {element}"
        return "Submission is valid"

    def process_deletions(self, date):
        # Process deletions for a given date
        deletions = []
        for submission in self.submissions:
            if "DeletionDate" in submission and submission["DeletionDate"] == date:
                deletions.append(submission)
        return deletions

class FABS:
    def __init__(self):
        self.submissions = []

    def submit_file(self, file_path):
        # Submit a file to FABS
        try:
            with open(file_path, 'r') as file:
                file_content = file.read()
                self.submissions.append(file_content)
                return f"File {file_path} submitted successfully"
        except FileNotFoundError:
            return f"File {file_path} not found"

    def validate_file(self, file_path):
        # Validate a file for FABS submission
        # Checking for file extension
        if not file_path.endswith(".csv"):
            return f"Invalid file extension: {file_path}"
        return "File is valid"

    def get_file_status(self, file_path):
        # Get the status of a submitted file
        for submission in self.submissions:
            if submission["FilePath"] == file_path:
                return submission["Status"]
        return "File not found"

